import React from 'react';

function NewReleases({ album, chooseNewRelease }) {

  function handlePlay() {
    chooseNewRelease(album);
  }
  return (
    <div className="container mt-0" onClick={handlePlay} style={{ cursor: 'pointer' }}>
      <div className="item"  >
        <img src={album.albumUrl} style={{ height: '200px', width: '200px' }}></img>
        <p>{album.name}</p>
      </div>
    </div >
  )
}

export default NewReleases;
